import { useState, useEffect } from "react";

function ItemsList({ pokemon }) {
  const [pokemonItem, setPokemonItem] = useState([{}]);

  useEffect(() => {
    console.log('9999999');
    pokemon.map((p) =>
      fetch(`https://pokeapi.co/api/v2/pokemon/${p}`)
        .then((response) => response.json())
        .then((character) => {
            setPokemonItem({
            name: character.forms.name,
            sprite: character.sprites.other['official-artwork'].front_default,
          })

        })
    );
  }, []);

  console.log("pokemonItem", pokemonItem);

  return (
    <div>
      {pokemon.map((p) => (
        <div key={p}>{p}</div>
      ))}
    </div>
  );
}

export { ItemsList };
